import * as React from 'react'
import Head from 'next/head'

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
}

function withLayout<T>(Component: React.ComponentType<T>) {
    return (props: T) => (
        <div style={layoutStyle}>
            <Head>
                <title>NextJS Template</title>
            </Head>
            <Component {...props} />
        </div>
    );
};

export default withLayout;
